<!DOCTYPE html>
<html lang="zh-TW">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>A Love Letter for MaoMao</title>
    <style>
        body, html {
            margin: 0;
            padding: 0;
            font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif;
            color: #333;
            overflow-x: hidden;
        }

        .background-image {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            z-index: -1;
            filter: blur(8px) brightness(0.7);
        }

        .container {
            max-width: 800px;
            margin: 50px auto;
            padding: 40px;
            background-color: rgba(255, 255, 255, 0.95);
            border-radius: 15px;
            box-shadow: 0 10px 30px rgba(0,0,0,0.2);
            text-align: center;
        }

        h1 {
            font-family: Georgia, serif;
            color: #6a0dad;
            margin-bottom: 30px;
            font-size: 2.8em;
            font-weight: normal;
            letter-spacing: 1px;
        }

        .clickable-area {
            cursor: pointer;
            transition: transform 0.3s ease, box-shadow 0.3s ease;
            margin-top: 40px;
        }

        .clickable-area img {
            width: 80%;
            max-width: 500px;
            border-radius: 10px;
            box-shadow: 0 5px 15px rgba(0,0,0,0.15);
        }

        .clickable-area:hover {
            transform: scale(1.03);
        }

        .clickable-area:active {
            transform: scale(0.98);
        }

        .clickable-area p {
            margin-top: 20px;
            color: #666;
            font-size: 1em;
            font-style: italic;
        }

        .modal {
            display: none; 
            position: fixed; 
            z-index: 100; 
            left: 0;
            top: 0;
            width: 100%;
            height: 100%;
            overflow: auto; 
            background-color: rgba(0,0,0,0.7); 
            padding: 20px;
            box-sizing: border-box;
        }

        .modal-content {
            background-color: #fefefe;
            margin: 5% auto;
            padding: 35px 45px;
            border: 1px solid #888;
            width: 90%;
            max-width: 700px;
            border-radius: 15px;
            box-shadow: 0 10px 40px rgba(0,0,0,0.4);
            animation: fadeIn 0.5s;
            max-height: 80vh;
            overflow-y: auto;
        }

        @keyframes fadeIn {
            from {opacity: 0; transform: translateY(-30px);}
            to {opacity: 1; transform: translateY(0);}
        }

        .close-button {
            color: #aaa;
            float: right;
            font-size: 32px;
            font-weight: bold;
            line-height: 20px;
            cursor: pointer;
            transition: color 0.3s;
        }

        .close-button:hover,
        .close-button:focus {
            color: #333;
        }

        .modal-content .greeting {
            font-size: 1.15em;
            margin-bottom: 20px;
            margin-top: 15px;
            color: #6a0dad;
            font-weight: 500;
        }

        .modal-content .letter-content {
            text-align: left;
            line-height: 1.9;
            font-size: 1.05em;
            color: #444;
        }

        .modal-content .letter-content p {
            margin-bottom: 16px;
        }

        .modal-content .signature {
            text-align: right;
            margin-top: 30px;
            font-style: italic;
            color: #6a0dad;
            font-size: 1.05em;
        }

        @media (max-width: 768px) {
            .container {
                margin: 20px;
                padding: 25px;
            }

            h1 {
                font-size: 2.2em;
            }

            .modal-content {
                padding: 25px 30px;
                margin: 10% auto;
            }
        }
    </style>
</head>
